    entitysData = [];
    if (!user.login) return;
    const { x, y, z } = player.position
    CASH_MACHINES_LIST.forEach(model => {
        const handle = mp.game.object.getClosestObjectOfType(x, y, z + 1, 3, model, true, true, true);
